window.bookSummaryJSON = "<p>Ivy believes that every life must have balance, and during the past year, she's found harmony living with the Weston pack. When an evil spirit from her past threatens her wolf, it sets off a chain reaction of events that alters the course of her destiny. </p> <p>Lorenzo Church is a powerful, wealthy Packmaster who rules his pack through intimidation and order. He has vowed to never love a woman because love can destroy an empire. But chaos is fast approaching in the form of a Shifter named Ivy - a Native American, like him, who has invaded his dreams since the moment they met. She is spirited, wise, and unattainable.</p>"; 
